import React from 'react';
import { Link } from 'react-router-dom';

export default function Titulo() {
    return (
        <section className="hero">
            <h1>Aprenda online com as melhores video aula</h1>
            <p>Na nossa plataforma, oferecemos uma ampla gama de cursos e 
                recursos sobre investimentos, desenvolvidos por especialistas do mercado. 
                Seja você um iniciante buscando entender o básico ou um investidor 
                experiente querendo aprimorar suas estratégias,
                aqui você encontrará tudo o que precisa.
            </p>
            <Link to="/videos">Vídeos</Link>
            <a href="./Cadastro.jsx" className="btn">Entrar!!!</a>
        </section>
    );
}
